import React from 'react';
import './App.css';
import Header from "./components/Header";
import CharCard from "./components/CharCard";
import Character from "./characters.json"

function App() {
    return (
    <div>
      <Header />
      <CharCard 
      image={Character[0].image}/>
    </div>
    );
}

export default App;
